%[text] # MST不変量のテンソルネットワークによる計算
%[text] ## 
%%
%[text] ## Find symbolicの仕様
%[text] すべて0になる配列だが，findは簡約化せずに見た目だけで判断する
syms symvariable
assume(symvariable^5==1)
expr=[0,symvariable^11-symvariable,symvariable^5-1, ...
    (symvariable+1)^2-symvariable^2-symvariable*2-1];
find(expr) %[output:9a5beb07]
find(expr~=0) %[output:5a2dcfa1]
isAlways(expr==0) %[output:6b34e7bb]
%%
%[text] ## 実例の計算
%[text] 下記のテンソルネットワークの計算を行う．
%%
%[text] ## 小さい量子群のBorel部分代数$u\_q(\\mathfrak{sl}\_2^+)$の導入
%[text] $E,K\n$を生成元,$q=\\exp(2\\pi i/N),\~\~E^N=0, \~\~K^N=1,\~\~KE=qEK$を関係式とする代数を導入する．
%[text] これは$N^2$次元のホップ代数の構造が入る．N=3,5で計算を行う．
%[text] (N=5だとメモリを遥かに上回る2TBが計算に要求されたのでやめた．次元の問題は深刻である)
%[text] MSTの論文はL派の流儀で行っているので
N=5;
[Z,K,E]=Uqsl2BorelSmall.getGenerator(1/N,"L") %[output:976fd219] %[output:530e8bd9] %[output:618a2e81]
Z.verifyHopf(@(x,y)all(eqD(x,y,1e-5),"all")) %[output:26112a3f]
%%

% [Z,K,E]=Uqsl2BorelSmall.getGenerator(N,"R",q) %[output:3fe6a4d9] %[output:4662ecb9] %[output:405d0624]
% Z.verifyHopf(@(x,y)all(eqD(x,y,1e-5),"all")) %[output:7849ddd0]
%[text] 関係式はこれでチェックできる．そして構造定数を取得する．
%%
Un=eye(Z.dim);
An=Z.getSC('_S');
Mu=Z.getSC('_μ');
De=Z.getSC('_Δ');
Et=Z.getSC('_η');
Ep=Z.getSC('_ε');
Ir=Z.getSC('_intr');
Il=Z.getSC('_intl');
Cr=Z.getSC('_cointr');
Cl=Z.getSC('_cointl');
%C250406より
Tp=Z.getSC('Tp');
Tm=Z.getSC('Tm');
qq=Z.getSC('_CrIl');
%%
% save('D250815tensor_data_uq_Z5.mat', 'Un', 'An', 'Mu', 'De', 'Et', 'Ep', 'Ir', 'Il', 'Cr', 'Cl', 'Tp', 'Tm');

%%
A1=calcTensorExpression('Tp{1,2,3,4}(An^2){4,1}',[3,2]); %こちらが正しい
A2=TP(Il,Cr,N=1);
eqD(A1,A2,1e-6) %[output:41de7c9c]
A1=calcTensorExpression('Tp{1,2,3,4}(An^2){1,4}',[3,2]);
A2=TP(Il,Cr,N=1);
eqD(A1,A2,1e-6) %[output:179084e1]
A1=calcTensorExpression('Tm{1,2,3,4}(An^2){2,3}',[4,1]); %こちらが正しい
A2=calcTensorExpression('Ep{2}Et{1}',[2,1]);
eqD(A1,A2,1e-6) %[output:5fb7e000]
A1=calcTensorExpression('Tm{1,2,3,4}(An^2){3,2}',[4,1]);
A2=calcTensorExpression('Ep{2}Et{1}',[2,1]);
eqD(A1,A2,1e-6) %[output:6c9bdf6c]
%%
%[text] #### invariant of avalone
%[text] $Z(S^3, f; H) = \\mu\_L(S^{-4}(e\_R)) = q^{-1}.$
A1=calcTensorExpression('Il{1}Cr{2}(An^-4){1,2}',[]) %[output:0381dc16]
A2=calcTensorExpression('Tp{1,2,3,4}(An^-4){3,2}(An^2){4,1}',[]) %[output:51eed111]
qq^-1 %[output:44cc63be]
%%
%[text] #### invariant of Lens space L(2,1)
%[text] ![](text:image:005a)
A1=calcTensorExpression('Tp{1,2,3,4}Tp{5,6,7,8}(An^-2){3,2}(An^-2){4,6}(An^2){5,8}(An^0){7,1}',[]) %[output:498aa4a4]
2*qq^-1*(1-qq^-floor((N+1)/2))/(1-qq^-1) %[output:2e941c53]
%[text] #### 
%%

A1=calcTensorExpression('Cr{1}Mu{1,2,3}',[2,3]);
A2=calcTensorExpression('Cr{1}Ep{0}',[0,1]);
max(abs(A1-A2)) %[output:1386fb51]
A1=An*Cr;
A2=q*Cl; %[output:97fef1c9]
max(abs(A1-A2))
A1=An^-1*Cr;
A2=Cl;
max(abs(A1-A2))
%%
Ir.'*An^2*Cr
%%
tmp=[Ir.'*Cr, Il.'*Cr; ... %[output:group:9c6193e4] %[output:24f14b3c]
     Ir.'*Cl, Il.'*Cl] %[output:group:9c6193e4] %[output:24f14b3c]
%%
Cro=Z.set_c(Cr)
Cro2=Delta(Cro);
Cro2.cf
%%
%[text] ## テンソル計算
%[text] MATLABのtensorprod関数を用いたテンソルの計算を紹介する．
%[text] たとえば，o-graphのtwistingに関する補題の具体的な検証は下記のようなテンソル計算で行われる．
%[text] ![スクリーンショット 2025-04-06 20.28.17.png](text:image:5059)
%%
A1=calcTensorExpression('Tp{0,1,2,3}(An^2){3,0}',[2,1]);
A2=TP(Il,Cr,N=1);
eqD(A1,A2,1e-6) %[output:489dd57e]
idx=~(eqD(0,A2,1e-6));
%[text] 同じ2階テンソル(行列)が対応している．
%%

expr=calcTensorExpression(['Tp{5,3,6,1}(An^4){7,6}(An^2){1,3}Tm{5,13,2,11}(An^-2){13,12}Tm{8,4,12,7}Tp{16,9,10,15}' ... %[output:group:2656944a] %[output:7c438110]
    '(An^-2){9,8}(An^-4){11,10}(An^-2){14,2}(An^2){15,16}(An^2){4,14}']) %[output:group:2656944a] %[output:7c438110]
expr=calcTensorExpression(['Tp{5,3,6,1}(Un){7,6}(An^2){1,3}Tm{5,13,2,11}(An^-2){13,12}Tm{8,4,12,7}Tp{16,9,10,15}' ... %[output:group:09557063] %[output:7a1ae31e]
    '(An^-2){9,8}(Un){11,10}(An^-2){14,2}(An^2){15,16}(An^2){4,14}']) %[output:group:09557063] %[output:7a1ae31e]
expr=calcTensorExpression(['Tp{5,3,6,1}(Un){7,6}(An^2){1,3}Tm{5,13,2,11}(An^-2){13,12}Tm{8,4,12,7}Tp{16,9,10,15}' ... %[output:group:21ad3bc6] %[output:013336dc]
    '(An^-2){9,8}(Un){11,10}(Un){4,2}(An^2){15,16}']) %[output:group:21ad3bc6] %[output:013336dc]

%[text] #### 値が異なるので，$N=3,\\;q=\\exp \\left(2\\pi i/3\\right)${"editStyle":"visual"}としたときのホップ代数はframingの変化をキャッチしているといえる．
%%
%[text] わっかを付け加える操作はUq(sl2+)の場合は0にすることと対応する？
abs(TP(De,An^2,1:2,[2 1]).')
%%
%[text] ## 群環の導入
%[text] 巡回群で計算してみる．
[Zc,One]=CyclicGroupAlg.getGenerator(5)
Zc.verifyHopf(@isequal)
(1+One)*(1+One^2)*(1+One^4)
Delta(One)
Zc.dispInt
%[text] Group algebraはunimodular & counimodularである．
%%
%[text] ## 問2の考察(続き)
%[text] Sweedlerの場合で引き続き計算を実行した．
%[text] #### **結果として，twist1~4でそれぞれ違うテンソル(16×16行列)が得られた．**
%[text] ![スクリーンショット 2025-04-08 22.18.30.png](text:image:19e4)
twist=cell(1,4);
twist{1}=reshape(eval(makeTensorExpression( ...
    'Tp{3,5,6,1}Tm{11,5,9,2}Tm{10,7,6,12}Tp{15,8,9,13}(An^2){13,15}(An^-2){8,7}(An^2){10,4}(An^-2){11,12}' ...
    ,1:4)),numel(Un)*[1 1]);
twist{2}=reshape(eval(makeTensorExpression( ...
    'Tm{1,6,5,3}Tp{2,9,5,11}Tp{12,6,7,10}Tm{13,9,8,15}(An^2){13,15}(An^-2){8,7}(An^2){10,4}(An^-2){11,12}' ...
    ,1:4)),numel(Un)*[1 1]);
twist{3}=reshape(eval(makeTensorExpression( ...
    'Tp{3,5,1,6}Tm{5,11,2,9}Tm{7,10,12,6}Tp{8,15,13,9}(An^2){15,13}(An^-2){7,8}(An^2){4,10}(An^-2){12,11}' ...
    ,1:4)),numel(Un)*[1 1]);
twist{4}=reshape(eval(makeTensorExpression( ...
    'Tm{3,5,1,6}Tp{9,2,11,5}Tp{6,12,10,7}Tm{9,13,15,8}(An^2){15,13}(An^-2){7,8}(An^2){4,10}(An^-2){12,11}' ...
    ,1:4)),numel(Un)*[1 1]);
expr=false(4,4);
for ii=1:4
    for jj=1:4
        expr(ii,jj)=isequal(twist{[ii,jj]});
    end
    disp("twist["+ii+"]")
    disp(twist{ii})
end
disp(expr) %twist1,2,3,4が互いに等しいかどうか　
%%
%[text] ## リングを付け足す操作について
%[text] 二重化されたavalonに下記のリングを付け足す操作での変化を見る．
%[text] ![](text:image:559d)
%[text] のテンソルは$u\_q \\left({\\textrm{sl}}\_2^+ \\right)${"editStyle":"visual"}だと0になるようである(数値的に)
%[text] N=5での計算例)
ring=TP(Tp,An^-2,[1 2],[1 2])
%[text] なので，ringをつなげると，不変量の値は0になる．
%%
%[text] cyclic group algebraの場合はringのテンソルは下記のような行列となる．
%[text] group algebraの場合は変化は無かった
ring=TP(Tp,An^-2,[1 2],[1 2])
expr=makeTensorExpression(['Tp{5,3,6,1}Tm{5,13,2,11}Tm{8,4,12,7}(An^-2){9,8}Tp{16,9,10,15}' ...
    '(An^4){7,6}(An^-4){11,10}(An^2){1,3}(An^-2){14,2}(An^2){15,16}ring{13,17}(An^-2){17,12}(An^2){4,14}'])
eval(expr)
expr=makeTensorExpression(['Tp{5,3,6,1}Tm{5,13,2,11}Tm{8,4,12,7}(An^-2){9,8}Tp{16,9,10,15}' ...
    '(An^4){7,6}(An^-4){11,10}(An^2){1,3}(An^-2){14,2}(An^2){15,16}Un{13,17}(An^-2){17,12}(An^2){4,14}'])
eval(expr)
